AdGroupWebpageServiceExcludedType:
  type: string
  nullable: true
  enum:
  - INCLUDED
  - EXCLUDED
  - UNKNOWN
  title: AdGroupWebpageServiceExcludedType
  description: |
    <div lang="ja">AdGroupWebpageServiceExcludedTypeは、配信対象、および除外対象の設定を表します。<br>
    ADD時、このフィールドは省略可能となります。その際、デフォルト値はINCLUDEDとなります。SET時、このフィールドは無視されます。</div>
    <div lang="en">AdGroupWebpageServiceExcludedType describes the setting type which delivers ads or do not delivers ads.<br>
    This field is optional in ADD operation, and will be ignored in SET operation. The default value in ADD operation will be 'INCLUDED'.</div>
    <dl class=term>
      <dt class="term__item">INCLUDED</dt>
      <dd class="term__desc"><span lang="ja">配信対象</span><span lang="en">Ads to be delivered.</span></dd>
      <dt class="term__item">EXCLUDED</dt>
      <dd class="term__desc"><span lang="ja">除外対象</span><span lang="en">Ads not to be delivered.</span></dd>
      <dt class="term__item">UNKNOWN</dt>
      <dd class="term__desc"><span lang="ja">未知の値です。</span><span lang="en">Unknown value.</span></dd>
    </dl>
